import Social from '.'

function Footer() {
  return (
    <>
      <footer className="bg-primary tColor">
        <div class="row">
            <div class="col-lg-4">quick links</div>
            <div class="col-lg-4">latest posts</div>
            <div class="col-lg-4">
               <Social/> 
            </div>
        </div>
      </footer>
    </>
  );
}

export default Footer;
